from typing import List

class Solution:
    def leftmostBuildingQueries(self, heights: List[int], queries: List[List[int]]) -> List[int]:
        def find_leftmost_building(ai, bi):
            leftmost = -1
            max_height = heights[ai]
            for j in range(ai + 1, bi + 1):
                if heights[j] > max_height:
                    if leftmost == -1:
                        leftmost = j
                    max_height = heights[j]
            return leftmost

        ans = []
        for ai, bi in queries:
            if ai == bi:
                ans.append(ai)  # Alice and Bob are already in the same building
            else:
                leftmost_meeting_point = find_leftmost_building(ai, bi)
                ans.append(leftmost_meeting_point)
        return ans
